import React, { Component } from 'react';
import { Tabs, Tab } from 'react-mdl';
import Project from './projectsComponents/project';
class Projects extends Component {
    constructor(props) {
        super(props)
        this.state = { activeTab: 0 };
    }
    toggleTabs(activeTab) {
        if (activeTab === 0) {
            return <Project activeTab={ this.state.activeTab } />
        } else if (activeTab === 1) {
            return <Project activeTab={ this.state.activeTab } />
        } else if (activeTab === 2) {
            return <Project activeTab={ this.state.activeTab } />
        }
    }

    render() {
        return (
            <div>
                <Tabs className="projects-tabs" activeTab={ this.state.activeTab } onChange={ (tabId) => this.setState({ activeTab: tabId }) } ripple>
                    <Tab>Starks</Tab>
                    <Tab>Lannisters</Tab>
                    <Tab>Targaryens</Tab>
                </Tabs>
                <section className="tab-content">
                    { this.toggleTabs(this.state.activeTab)}
                </section>
            </div>    
        );
    }
}

export default Projects;
